Infested: Series 2

Health-Medical Documentary hosted by Eric Meyers, published by Discovery Channel in 2012 - English narration


Information
------------------------------

Infested: Series 2
Infested unearths real-life horror stories of homes crawling with cockroaches, over-run with rats, invaded by bedbugs, and plagued by vermin hazardous to your physical and mental health. Determined to claim family homes as their own, these invaders use overwhelming numbers, sustained attacks and the threat of disease to conquer houses and apartments. Homes become battlegrounds, leaving their human victims with no place to hide. First-hand accounts and dramatic recreations reveal the pain and anguish of each family s fight to reclaim their homes as their own, but no matter what the outcome, home will never feel the same again.


1)  Crawls from the Walls 
In Tennessee, a married couple and their two children settle down to life in a rural area, where they start finding many bugs. Initially, it doesn't seem like a problem, until a brown recluse spider enters. Suddenly, the husband/father receives a bite that turns out to be so serious that it forces him to go to the hospital. Knowing there are many more spiders in the house, the family attempts to get rid of them with pest control treatments. In Pennsylvania, another family of four have been enjoying life in a close-knit community. However, they notice that one house in their neighbourhood is rather unkempt and its residents isolate themselves. As if that isn't unsettling enough, the family discovers German cockroaches spreading from the neighbours' house to theirs. In Georgia, a college student moves back home with his parents. Everyone tries to adjust to life in the south, but they soon learn that bedbugs have invaded their house. Throwing out the bedroom couch and getting an exterminator's help seems to be the solution, but the bedbugs continue to give the family problems



